import React from 'react';
import { Container, Col, Row, Button,DropdownButton,Dropdown } from 'react-bootstrap';
class Header extends React.Component {
    render() { 
        return ( 
            <Container fluid="true">
            <Row style={{height:'7vh'}}>
            <Col style={{backgroundColor: 'yellow'}}>logo</Col>
            <Col xs xl={10} lg md sm >PVG</Col>
            <Col style={{backgroundColor:'pink'}}>
            <DropdownButton title="Dropdown button" size="sm">
  <Dropdown.Item as="button" >Action</Dropdown.Item>
  <Dropdown.Item as="button">Another action</Dropdown.Item>
  <Dropdown.Item as="button">Something else</Dropdown.Item>
</DropdownButton>
            </Col>
            </Row>
            </Container> 
        );
    }
}
 
export default Header;
